import React,{lazy,Suspense} from "react";
const Main=lazy(()=>import ('./elementos/main'));
import ".//app.css"
const App=()=>{

    return(
    <Suspense >
    <div className="app">
        <header>
            Mi primer proyecto de App
        </header>
        <Main />
    </div>
    </Suspense>
    )
}
export default App
